import React from "react";
import CategorySubPage from "../components/CategorySubPage";
import ChallengesTable from "../components/ChallengesTable";

const BinaryExploitationChallenges = () => {
  // This could be moved to a separate data file or fetched from an API
  const challenges = [
    { id: 1, name: "Buffer Overflow 101", difficulty: "Easy", points: 100, completed: false },
    { id: 2, name: "ROP Chain Adventure", difficulty: "Medium", points: 200, completed: false },
    { id: 3, name: "Heap Exploitation", difficulty: "Hard", points: 300, completed: false },
  ];

  const challengesContent = (
    <ChallengesTable 
      challenges={challenges} 
      categoryPath="/binary-exploitation"
    />
  );

  return (
    <CategorySubPage
      title="Binary Exploitation Challenges"
      content={challengesContent}
      buttons={[
        {
          text: "Back to Overview",
          path: "/binary-exploitation",
          variant: "secondary",
        },
      ]}
    />
  );
};

export default BinaryExploitationChallenges;
